import styled from "styled-components";
import { BlockHeader,
         Text } from "../basic"; 

const BlockContainer = styled.div`
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);

    width: 574px;
    height: auto;
`

const FormContainer = styled.div`
    width: 100%;
    background-color: white;
    box-shadow: 5px 5px 6px grey;
    padding: 30px;
    border-radius: 20px;
`

export const InitialForm = () => {
    return(<>
        <BlockContainer>
            <BlockHeader>Sign up</BlockHeader>
            <FormContainer>
                <Text fontSize={25} color={"black"}>WELCOME TO BIBRAIN</Text>
            </FormContainer>
        </BlockContainer>
    </>)
}
